import styled from "styled-components";

export const Container = styled.div`
  float: left;
  margin: 0;
  height: 100%;
  width: 100%;
`;

export const ListItems = styled.div`
  display: block;
  padding: 5px 0;
`;

export const H3 = styled.h3`
  float: left;
  margin-top: 5px;
  padding: 0;
  display: block;
`;

export const Icon = styled.div`
  float: right;
  margin-top: 5px;
  padding: 0;
  display: block;
`;

export const Container__header_icon = styled.div`
  width: 100%;
`;
